// FileName: Song.js

import React from "react";

const Song = ({ currentSong }) => {
    return (
        <div className="song-container">
            <img src={require('../../assets/images/music.png')} alt={currentSong.name} />
            <h2>{currentSong.name}</h2>
            <h3>{currentSong.artist}</h3>
        </div>
    );
};

export default Song;
